import React from "react";

import Description from "components/Description/Description";
import Statistics from "components/Statistics/Statistics";

const Profile = () => {
  return (
    <>
      <Description
        username={username}
        tag={tag}
        location={location}
        avatar={avatar}
      />
      <Statistics />
    </>
  );
};

export default Profile;
